<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>TERMINAL</title>
    <link rel="icon"
        href="data:image/svg+xml,<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 100 100'><rect width='100' height='100' fill='%23000'/><rect x='20' y='20' width='60' height='60' fill='none' stroke='%23ff0000' stroke-width='4'/></svg>">
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link
        href="https://fonts.googleapis.com/css2?family=VT323&family=Chakra+Petch:wght@400;500;600;700&family=Oxanium:wght@400;500;600;700&display=swap"
        rel="stylesheet">
    <style>
        *,
        *::before,
        *::after {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        :root {
            --red: #ff0000;
            --red-dark: #cc0000;
            --red-dim: #660000;
            --orange: #ff4400;
            --yellow: #ffaa00;
            --black: #000000;
            --gray-dark: #0a0a0a;
            --gray: #141414;
            --gray-mid: #222222;
            --gray-light: #333333;
            --white: #ffffff;
            --white-dim: rgba(255, 255, 255, 0.6);
            --white-muted: rgba(255, 255, 255, 0.3);
            --online: #00ff00;
            --idle: #ffaa00;
            --dnd: #ff0000;
            --offline: #444444;
        }

        html {
            width: 100%;
            height: 100%;
            background: var(--black);
        }

        body {
            width: 100%;
            min-height: 100%;
            overflow-x: hidden;
            overflow-y: auto;
            background: var(--black);
            font-family: 'Chakra Petch', sans-serif;
            color: var(--white);
        }

        body.locked {
            overflow: hidden;
        }

        .video-container {
            position: fixed;
            inset: 0;
            z-index: -2;
        }

        .video-container video {
            width: 100%;
            height: 100%;
            object-fit: cover;
            opacity: 0.5;
        }

        .overlay-dark {
            position: fixed;
            inset: 0;
            z-index: -1;
            background: linear-gradient(180deg, rgba(0, 0, 0, 0.4) 0%, rgba(0, 0, 0, 0.7) 100%);
        }

        .scanlines {
            position: fixed;
            inset: 0;
            z-index: 100;
            pointer-events: none;
            background: repeating-linear-gradient(0deg,
                    transparent 0px,
                    transparent 1px,
                    rgba(0, 0, 0, 0.15) 1px,
                    rgba(0, 0, 0, 0.15) 2px);
        }

        .corner-frame {
            position: fixed;
            z-index: 50;
            pointer-events: none;
        }

        .corner-frame.tl {
            top: 20px;
            left: 20px;
        }

        .corner-frame.tr {
            top: 20px;
            right: 20px;
        }

        .corner-frame.bl {
            bottom: 20px;
            left: 20px;
        }

        .corner-frame.br {
            bottom: 20px;
            right: 20px;
        }

        .corner-frame svg {
            width: 40px;
            height: 40px;
        }

        .corner-frame.tr svg {
            transform: rotate(90deg);
        }

        .corner-frame.br svg {
            transform: rotate(180deg);
        }

        .corner-frame.bl svg {
            transform: rotate(270deg);
        }

        .top-bar {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            height: 3px;
            background: linear-gradient(90deg, transparent, var(--red), transparent);
            z-index: 60;
        }

        .bottom-bar {
            position: fixed;
            bottom: 0;
            left: 0;
            right: 0;
            height: 3px;
            background: linear-gradient(90deg, transparent, var(--red-dim), transparent);
            z-index: 60;
        }

        .enter-screen {
            position: fixed;
            inset: 0;
            z-index: 9999;
            background: var(--black);
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            cursor: pointer;
            transition: opacity 0.5s ease, visibility 0.5s ease;
        }

        .enter-screen.hidden {
            opacity: 0;
            visibility: hidden;
            pointer-events: none;
        }

        .enter-frame {
            width: 300px;
            height: 200px;
            border: 2px solid var(--red);
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            position: relative;
        }

        .enter-frame::before {
            content: '';
            position: absolute;
            top: -10px;
            left: 50%;
            transform: translateX(-50%);
            width: 100px;
            height: 3px;
            background: var(--red);
        }

        .enter-frame::after {
            content: '';
            position: absolute;
            bottom: -10px;
            left: 50%;
            transform: translateX(-50%);
            width: 100px;
            height: 3px;
            background: var(--red);
        }

        .enter-title {
            font-family: 'Oxanium', sans-serif;
            font-size: 1.8rem;
            font-weight: 700;
            letter-spacing: 8px;
            color: var(--red);
            margin-bottom: 20px;
        }

        .enter-sub {
            font-family: 'VT323', monospace;
            font-size: 1rem;
            letter-spacing: 4px;
            color: var(--white-muted);
            animation: blink 1s step-end infinite;
        }

        @keyframes blink {
            50% {
                opacity: 0.3;
            }
        }

        .enter-corners {
            position: absolute;
            width: 15px;
            height: 15px;
            border: 2px solid var(--red);
        }

        .enter-corners.tl {
            top: -2px;
            left: -2px;
            border-right: none;
            border-bottom: none;
        }

        .enter-corners.tr {
            top: -2px;
            right: -2px;
            border-left: none;
            border-bottom: none;
        }

        .enter-corners.bl {
            bottom: -2px;
            left: -2px;
            border-right: none;
            border-top: none;
        }

        .enter-corners.br {
            bottom: -2px;
            right: -2px;
            border-left: none;
            border-top: none;
        }

        .main-wrapper {
            min-height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            padding: 60px 30px;
            opacity: 0;
            transform: translateY(20px);
            transition: all 0.4s ease;
            pointer-events: none;
        }

        .main-wrapper.active {
            opacity: 1;
            transform: translateY(0);
            pointer-events: auto;
        }

        .cards-container {
            display: flex;
            gap: 50px;
        }

        .card {
            width: 320px;
            background: rgba(10, 10, 10, 0.9);
            border: 1px solid var(--gray-light);
            position: relative;
            opacity: 0;
            transform: scale(0.95);
        }

        .card.show {
            animation: cardIn 0.4s ease forwards;
        }

        .card:nth-child(2).show {
            animation-delay: 0.1s;
        }

        @keyframes cardIn {
            to {
                opacity: 1;
                transform: scale(1);
            }
        }

        .card-header {
            height: 4px;
            background: linear-gradient(90deg, var(--red-dim), var(--red), var(--orange), var(--red), var(--red-dim));
        }

        .card-id {
            position: absolute;
            top: 15px;
            right: 15px;
            font-family: 'VT323', monospace;
            font-size: 0.9rem;
            color: var(--red);
            letter-spacing: 2px;
        }

        .card-body {
            padding: 30px 25px;
        }

        .avatar-section {
            display: flex;
            align-items: center;
            gap: 20px;
            margin-bottom: 25px;
        }

        .avatar-box {
            width: 80px;
            height: 80px;
            position: relative;
            flex-shrink: 0;
        }

        .avatar-border {
            position: absolute;
            inset: 0;
            border: 2px solid var(--gray-light);
            transition: border-color 0.3s ease;
        }

        .avatar-border.online {
            border-color: var(--online);
        }

        .avatar-border.idle {
            border-color: var(--idle);
        }

        .avatar-border.dnd {
            border-color: var(--dnd);
        }

        .avatar-corner {
            position: absolute;
            width: 8px;
            height: 8px;
            background: var(--red);
        }

        .avatar-corner.tl {
            top: -2px;
            left: -2px;
        }

        .avatar-corner.tr {
            top: -2px;
            right: -2px;
        }

        .avatar-corner.bl {
            bottom: -2px;
            left: -2px;
        }

        .avatar-corner.br {
            bottom: -2px;
            right: -2px;
        }

        .avatar-img {
            width: 100%;
            height: 100%;
            object-fit: cover;
            display: block;
        }

        .status-dot {
            position: absolute;
            bottom: -4px;
            right: -4px;
            width: 16px;
            height: 16px;
            background: var(--offline);
            border: 3px solid var(--black);
        }

        .status-dot.online {
            background: var(--online);
            box-shadow: 0 0 10px var(--online);
        }

        .status-dot.idle {
            background: var(--idle);
        }

        .status-dot.dnd {
            background: var(--dnd);
            box-shadow: 0 0 10px var(--dnd);
        }

        .user-info {
            flex: 1;
        }

        .username {
            font-family: 'Oxanium', sans-serif;
            font-size: 1.4rem;
            font-weight: 700;
            letter-spacing: 4px;
            color: var(--white);
            margin-bottom: 5px;
        }

        .user-time {
            font-family: 'VT323', monospace;
            font-size: 0.85rem;
            color: var(--white-muted);
            letter-spacing: 2px;
        }

        .user-time span {
            color: var(--red);
        }

        .divider {
            height: 1px;
            background: linear-gradient(90deg, transparent, var(--gray-light), transparent);
            margin: 20px 0;
        }

        .bio-block {
            margin-bottom: 20px;
        }

        .bio-label {
            font-family: 'VT323', monospace;
            font-size: 0.75rem;
            color: var(--red);
            letter-spacing: 3px;
            margin-bottom: 10px;
        }

        .bio-line {
            font-family: 'VT323', monospace;
            font-size: 0.95rem;
            color: var(--white-dim);
            line-height: 1.6;
            letter-spacing: 1px;
        }

        .bio-line strong {
            color: var(--white);
            font-weight: 400;
        }

        .bio-line.accent {
            color: var(--yellow);
        }

        .activity-block {
            background: rgba(0, 0, 0, 0.5);
            border: 1px solid var(--gray-mid);
            padding: 15px;
            margin-bottom: 20px;
            min-height: 65px;
            display: flex;
            align-items: center;
            gap: 12px;
        }

        .activity-label {
            position: absolute;
            top: -8px;
            left: 10px;
            font-family: 'VT323', monospace;
            font-size: 0.7rem;
            color: var(--red-dim);
            background: var(--gray-dark);
            padding: 0 5px;
            letter-spacing: 2px;
        }

        .activity-block {
            position: relative;
        }

        .activity-art {
            width: 40px;
            height: 40px;
            background: var(--gray-mid);
            flex-shrink: 0;
        }

        .activity-content {
            flex: 1;
            min-width: 0;
        }

        .activity-type {
            font-family: 'VT323', monospace;
            font-size: 0.7rem;
            color: var(--orange);
            letter-spacing: 2px;
            margin-bottom: 3px;
        }

        .activity-name {
            font-family: 'Chakra Petch', sans-serif;
            font-size: 0.8rem;
            font-weight: 600;
            color: var(--white);
            white-space: nowrap;
            overflow: hidden;
            text-overflow: ellipsis;
        }

        .activity-detail {
            font-family: 'VT323', monospace;
            font-size: 0.75rem;
            color: var(--white-muted);
            white-space: nowrap;
            overflow: hidden;
            text-overflow: ellipsis;
        }

        .activity-time {
            font-family: 'VT323', monospace;
            font-size: 0.7rem;
            color: var(--online);
            margin-top: 4px;
        }

        .activity-idle {
            font-family: 'VT323', monospace;
            font-size: 0.85rem;
            color: var(--white-muted);
            letter-spacing: 2px;
            width: 100%;
            text-align: center;
        }

        .discord-btn {
            display: block;
            width: 100%;
            padding: 14px;
            background: transparent;
            border: 2px solid var(--red-dim);
            color: var(--white);
            font-family: 'Oxanium', sans-serif;
            font-size: 0.75rem;
            font-weight: 600;
            letter-spacing: 4px;
            text-align: center;
            text-decoration: none;
            text-transform: uppercase;
            cursor: pointer;
            transition: all 0.2s ease;
            position: relative;
        }

        .discord-btn::before {
            content: '';
            position: absolute;
            left: 0;
            top: 0;
            bottom: 0;
            width: 0;
            background: var(--red);
            transition: width 0.2s ease;
            z-index: -1;
        }

        .discord-btn:hover {
            border-color: var(--red);
            color: var(--white);
        }

        .discord-btn:hover::before {
            width: 100%;
        }

        .audio-toggle {
            position: fixed;
            bottom: 25px;
            right: 25px;
            width: 45px;
            height: 45px;
            background: rgba(10, 10, 10, 0.9);
            border: 1px solid var(--gray-light);
            display: flex;
            align-items: center;
            justify-content: center;
            cursor: pointer;
            z-index: 200;
            opacity: 0;
            pointer-events: none;
            transition: all 0.3s ease;
        }

        .audio-toggle.show {
            opacity: 1;
            pointer-events: auto;
        }

        .audio-toggle:hover {
            border-color: var(--red);
        }

        .audio-toggle svg {
            width: 20px;
            height: 20px;
            fill: var(--white-dim);
        }

        .audio-toggle:hover svg {
            fill: var(--white);
        }

        @media (max-width: 750px) {
            .cards-container {
                flex-direction: column;
                gap: 30px;
                align-items: center;
            }

            .card {
                width: 100%;
                max-width: 340px;
            }

            .main-wrapper {
                padding: 40px 15px 80px;
                min-height: auto;
                align-items: flex-start;
            }

            .bio-line {
                font-size: 0.85rem;
                word-wrap: break-word;
            }

            .username {
                font-size: 1.2rem;
                letter-spacing: 2px;
            }

            .card-body {
                padding: 20px 18px;
            }

            .avatar-section {
                gap: 15px;
            }

            .avatar-box {
                width: 65px;
                height: 65px;
            }

            .discord-btn {
                padding: 12px;
                font-size: 0.7rem;
                letter-spacing: 2px;
            }
        }
    </style>
</head>
